    Photo.find(10245).update!(id: '10245', name: 'Baltimore Avenue', description: 'The description on the back of the photograph reads:  "Balt. Ave. looking north from 14th St.  Bldg on left is the K.C. Club bldg. and on the right is Kansas City\'s largest retail furniture store, the Robt. Keith Co."  The building immediately across from the Kansas City Club is the President Hotel.  The furniture store is just north of the hotel.  The New York Life Insurance Building is in view at the end of the street.  A city bus is also in view on the street going south.', date: '1936', tags: 'Cityscape photographs; Cityscapes;; Downtown; Streets; Baltimore Avenue; Kansas City Club Building; Hotel President;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Askren&CISOPTR=179&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Askren&CISOPTR=179', width: '750', height: '994', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-23 18:08:41 UTC', updated_at: '2016-10-24 00:13:14 UTC', )
