    Photo.find(10253).update!(id: '10253', name: 'Harry S. Truman Library and Museum', description: 'Exterior view of the front entrance of the Harry S. Truman Library and Museum taken during the dedication ceremony which was held for the Thomas Hart Benton mural located in the front lobby area of the library.  View includes those seated by the podium and those seated in chairs attending.  The man speaking is identified as David D. Lloyd.  Seated behind the podium between the columns are left to right:  Harry Truman, Chief Justice Earl Warren, and Thomas Hart Benton directly behind the speaker.', date: '1961-04-15', tags: 'Dedications; Murals; Presidents; Libraries; Galleries & museums;; Truman, Harry S.; Harry S. Truman Library and Museum; Benton, Thomas Hart (Artist);', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Askren&CISOPTR=187&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Askren&CISOPTR=187', width: '750', height: '583', address: '', latitude: '', longitude: '', angle: '', location_id: '13169', active: 'false', created_at: '2016-09-23 18:11:29 UTC', updated_at: '2016-10-24 00:15:48 UTC', )
