    Photo.find(10298).update!(id: '10298', name: 'Municipal Airport', description: 'Low, aerial view of Municipal Airport, looking toward the south with the Kansas City, Missouri skyline in view.  A portion of the runway and the airport terminal building are visible as well as various airplanes on the ground.  The Broadway Bridge, 2nd Hannibal Bridge and ASB Bridge can be seen crossing the Missouri River.', date: 'circa 1970', tags: 'Airports; Airport terminals; Runways (Aeronautics); Cityscapes; Airplanes; Aerial photographs;; Municipal Airport; Aerials;Missouri River; Skylines; Downtown;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Askren&CISOPTR=296&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Askren&CISOPTR=296', width: '750', height: '613', address: '', latitude: '', longitude: '', angle: '', location_id: '10532', active: 'false', created_at: '2016-09-23 18:27:15 UTC', updated_at: '2016-10-24 00:16:22 UTC', )
    Photo.find(10302).update!(id: '10302', name: 'Aerial View of Downtown Kansas City', description: 'Panoramic aerial view of downtown Kansas City looking north to the Missouri River, taken from "1000 ft. above 13th & Summit Streets from Lawrence Captive Airship," per caption printed on photograph.  From center of image, Jefferson Street extends north and 13th extends east.  The large buildings in the foreground flanked by Summit and Jefferson are private stables, with a number of apartment buildings lining Jefferson on the east.', date: '1907', tags: 'Cityscape photographs; Cityscapes; Buildings; Aerial photographs;; West Side; Downtown;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Askren&CISOPTR=429&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Askren&CISOPTR=429', width: '750', height: '329', address: '', latitude: '', longitude: '', angle: '', location_id: '13318', active: 'true', created_at: '2016-09-23 19:34:09 UTC', updated_at: '2016-10-23 23:45:32 UTC', )
