    Photo.find(10743).update!(id: '10743', name: 'World War I Funeral Service', description: 'Exterior view of the funeral service in process for World War I soldier John J. Bush, who died October 4, 1918 in the Argonne battle.  He was buried on October 23, 1921 in St. Mary\'s Cemetery in Kansas City.  He was 24 years old at the time of his death.  Includes an oval portrait insert of Mr. Bush.', date: '1918', tags: 'Missouri Valley Historical Society; World War I; Bush, John J.; Funerals; Soldiers', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=894&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=894', width: '750', height: '551', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:07:02 UTC', updated_at: '2016-10-23 23:14:12 UTC', )
