    Photo.find(10760).update!(id: '10760', name: 'David Buckner Willock, IV', description: 'Portrait of David Buckner Willock IV, a 1st Lt. in the U. S. Army Air Corps.  Wilcock was born in Kansas City, Missouri on May 11, 1923, to David Buckner Willock and Myra A. Willock.  He enlisted on January 26, 1942, as an air cadet and died on May 10, 1944, while on a mission in the Pacific.  He was awarded four medals, four Presidential Citations, eighteen Oak Leaf Clusters, and the Purple Heart.', date: 'Circa 1942', tags: 'World War II; Gold Star Mothers of Kansas City; Willock, David Buckner, IV', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=924&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=924', width: '750', height: '949', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:12:56 UTC', updated_at: '2016-10-24 00:13:14 UTC', )
    Photo.find(10795).update!(id: '10795', name: 'Lindell Hotel', description: 'Full, street level view of the Lindell Hotel located at the northwest corner of 5th and Wyandotte in Kansas City, Missouri. Appears to be one half of a two image stereopticon card. Handwritten on the back of the card: Lindell Hotel, Kansas City, Mo. N.W. cor. 5th & Wyandotte Sts, 60x100 feet, 4 stories high, with wing 20x30, 3 stories high. Owned by Theo. S. Case, Kansas City, Mo.', date: 'N.d.', tags: 'Hotels;; Lindell Hotel;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=975&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=975', width: '750', height: '789', address: '', latitude: '', longitude: '', angle: '', location_id: '14165', active: 'false', created_at: '2016-09-24 15:46:24 UTC', updated_at: '2016-10-24 00:20:58 UTC', )
    Photo.find(10797).update!(id: '10797', name: 'Battle of Westport Commemoration', description: 'Exterior view of three individuals holding hands, two men and one woman in historical period costume.  None of the people are identified nor is the exact location known.  The back of the photo says "Battle of Westport" and it appears that in the photograph a former Confederate soldier and a former Union man are extending the hand of friendship.  May have been a ceremony held at one of the anniversaries of the Battle of Westport, perhaps the 50th (1914).', date: 'N.d.', tags: 'Commemoration;; Battle of Westport; Civil War; Historical Reenactments;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=977&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=977', width: '750', height: '626', address: '', latitude: '', longitude: '', angle: '', location_id: '9489', active: 'false', created_at: '2016-09-24 15:47:07 UTC', updated_at: '2016-10-24 00:20:59 UTC', )
    Photo.find(10798).update!(id: '10798', name: 'Henry Boshell', description: 'Portrait of Henry Boshell, a Lieutenant in the Army Air Corps.  Boshell, also known as Bud, was born July 31, 1921.  He attended the Greenwood School and Central High School in Kansas City, graduating in 1938.  After graduation, Boshell entered a one year Army training program  and eventually left for Goose Bay in Labrador on April 9, 1944, from Tampa, Florida.  It was during this trip that his palne, a B-17, went down in a severe storm.', date: 'Circa 1943', tags: 'World War II; Gold Star Mothers of Kansas City; Boshell, Henry', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=978&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=978', width: '750', height: '979', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:47:27 UTC', updated_at: '2016-10-23 23:14:12 UTC', )
    Photo.find(10800).update!(id: '10800', name: 'William Allen Sarver', description: 'Portriat of William Allen Sarver, a Lieutenant in the U. S. Army.  Sarver was born on January 31, 1920 in Kansas City, Missouri and attended Central High School.  Upon graduation he played semi-professional baseball in Amsterdam, New York and enlisted on November 2, 1941.  He attended Officer\'s Training School in July 1942, and was married to Marian Smith on December 9, 1942.  He was sent to Germany and died while in battle at a German outpost on April 6, 1945.', date: 'Circa 1941', tags: 'World War II;; Gold Star Mothers of Kansas City; Sarver, William Allen', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=980&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=980', width: '750', height: '1073', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:48:09 UTC', updated_at: '2016-10-23 23:14:12 UTC', )
    Photo.find(10802).update!(id: '10802', name: 'Robert H. Davis', description: 'Portrait of Robert H. Davis, a Staff Sergeant in the Army Air Corps.  Davis was born on Spetmeber 17, 1919 in Kansas City, Missouri and enlisted  on June 16, 1942.  In December of 1943, he was sent to Italy after receiving his assignment as a Tail Gunman on a liberation bomber.  He was reported MIA while over Austria on May 30, 1944, and it was later confirmed that he was killed in action.  He was awarded an Air Medal, a Bronze Oak Leaf Cluster, and the Purple Heart.', date: 'Circa 1942', tags: 'World War II;; Gold Star Mothers of Kansas City; Davis, Robert H.', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=982&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=982', width: '750', height: '1139', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:48:50 UTC', updated_at: '2016-10-24 00:13:14 UTC', )
    Photo.find(10810).update!(id: '10810', name: 'Clifford D. Williams, Jr.', description: 'Portrait of Clifford D. Williams, Jr., a Sergeant in the U.S. Army.  Williams was born on January 21, 1918, in Kansas City, Missouri and attended East High School.  He enlisted on October 14, 1942, and in December of 1943, was sent to Italy for combat.  On February 25, 1944, his plane was attacked by German fighters and was shot down.  He was one of six men that were not able to escape the plane and died.  He was awarded the Air Medal with an Oak Leaf Cluster, a Presidential Citation, the European Theatre Ribbon with four Battle Stars, the Purple Heart, a Good Conduct Ribbon, and a Victory Medal.', date: 'Circa 1942', tags: 'World War II;; Gold Star Mothers of Kansas City; Williams, Clifford D., Jr.', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=993&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=993', width: '750', height: '1034', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 15:51:37 UTC', updated_at: '2016-10-24 00:13:14 UTC', )
    Photo.find(10812).update!(id: '10812', name: 'Harry Truman', description: 'Photograph shows officials on podium at 50th anniversary of University of Kansas City Law School.  President Truman (center) is being greeted by a child. Mayor John Gage at left and Law School Dean Clarence Decker is at far right.', date: 'July 28, 1945', tags: 'Presidents; Legal education; Anniversaries;; University of Kansas City; Kansas City School of Law;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=995&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=995', width: '750', height: '964', address: '', latitude: '', longitude: '', angle: '', location_id: '9489', active: 'false', created_at: '2016-09-24 15:52:19 UTC', updated_at: '2016-10-24 00:21:08 UTC', )
