    Photo.find(10867).update!(id: '10867', name: 'Gilbert L. Worley, Jr.', description: 'Portrait of Lt. Gilbert L. Worley, Jr., a flyer in the United States Army.  He was born in Topeka, Kansas, April 12, 1920.  He graduated from Southwest High School in Kansas City and from Kansas University in 1941 where he started his flying courses.  His training was completed at Ong Field and he was qualified as a navigator and ground school instructor.  In 1942 he completed his training to become an Army flyer.  He was killed in an airplane accident on a flight to Indianapolis on May 15, 1943.', date: 'circa 1942', tags: 'World War II; Soldiers; Air pilots; Military air pilots; War;; Gold Star Mothers of Kansas City;Worley, Gilbert L., Jr.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=1059&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=1059', width: '750', height: '1062', address: '', latitude: '', longitude: '', angle: '', location_id: '12862', active: 'false', created_at: '2016-09-24 16:11:44 UTC', updated_at: '2016-10-24 00:21:38 UTC', )
    Photo.find(10868).update!(id: '10868', name: 'John Raymond Winslow', description: 'Portrait of John Raymond Winslow, a Lieutenant in the Army Air Corp.  He was born on September 28, 1921 in Chanute, Kansas to David and Sylvia Winslow.  The family moved to Kansas City, Kansas in 1930, graduating from high school in 1939.  In 1942, after finishing junior college in this area, he enlisted and trained at Randolph Field in Texas.  He left the United States in March 1944 for duty in the Italian campaign, attached to 87th Fighter Squadron, 79th Fighter Group, 12th Air Force.  His last mission was June 8, 1944 falling into enemy territory somewhere in northern Italy.  His body was returned to the United States in 1949 and he is buried in Fort Leavenworth National Cemetery.  He left a wife Betty and two sons.', date: 'circa 1940-45', tags: 'World War II; Air pilots; Military air pilots; War; Soldiers;; Gold Star Mothers of Kansas City;Winslow, John R.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=1060&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=1060', width: '750', height: '979', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 16:12:05 UTC', updated_at: '2016-10-24 00:13:14 UTC', )
    Photo.find(10869).update!(id: '10869', name: 'Frazier R. Stair', description: 'A view of First Lieutenant Frazier R. Stair, 430th Fighter Squadron, 47th Fighter Group, Ninth Army Air Force, positioned in his airplane.  He was born in Kansas City, Missouri on November 9, 1920 and graduated from Westport High School and Kansas City Junior College.  He was a member of the National Guard, State of Missouri, 110th Engineer Combat Battalion.  After entering the Army Air Corp he went overseas in the spring of 1944 as a Second Lieutenant Fighter Pilot of a P-38.  He lost his life on November 6, 1944 on a bombing mission over Germany.  He was awarded many medals and is buried in Hamm Cemetery in Luxemborg.', date: 'circa 1944', tags: 'World War II; Air pilots; Military air pilots; War; Soldiers;; Gold Star Mothers of Kansas City;Stair, Frazier R.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=1061&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=1061', width: '750', height: '1094', address: '', latitude: '', longitude: '', angle: '', location_id: '11680', active: 'false', created_at: '2016-09-24 16:12:25 UTC', updated_at: '2016-10-24 00:21:40 UTC', )
