    Photo.find(10878).update!(id: '10878', name: 'President Grover Cleveland and Wife Frances', description: 'President Grover Cleveland and his wife Frances sit in an open horse-drawn carriage in front of homes/buildings at 1216-1218 Broadway in Kansas City, Missouri. Scene includes on-lookers as well as a good view of the horses pulling the carriage. Handwritten in ink at the bottom of the photo is "Pres. Cleveland in K.C. 1887" and "In front of 1216-1218 Broadway."', date: '1887', tags: 'Carriages & coaches; Horses; Presidents;; Broadway Boulevard; Cleveland, Grover; Cleveland, Frances F.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Assorted&CISOPTR=1078&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Assorted&CISOPTR=1078', width: '750', height: '685', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-24 16:15:32 UTC', updated_at: '2016-10-23 23:14:12 UTC', )
