    Photo.find(11204).update!(id: '11204', name: 'Joe Sanders Collection Exhibit', description: 'Interior view associated with the Joe Sanders Collection exhibit on view at the Kansas City Public Library,  12th and Oak, 3rd floor, Art and Music Department in downtown Kansas City during October 18 - November 6, 1965.  Woman on the left is Gertrude Sanders, widow of Joe Sanders, who presented the library the opportunity to acquire the collection.  Other two individuals are Charles Green and Mrs. Thelma Green, Mt. Carmel, Illinois.', date: '1965', tags: 'Sanders, Gertrude; Sanders, Joe; Exhibits; Kansas City Public Library', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/CoonSanders&CISOPTR=260&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/CoonSanders&CISOPTR=260', width: '750', height: '1079', address: '', latitude: '', longitude: '', angle: '', location_id: '13365', active: 'false', created_at: '2016-09-24 18:08:47 UTC', updated_at: '2016-10-24 00:25:05 UTC', )
    Photo.find(11214).update!(id: '11214', name: 'Sheet Music Cover', description: 'View is of sheet music entitled "Am I Dreaming?", words and music by Joe Davis, Bobby Gregory and Charles Dornberger.  It contains on the cover a composite of various band/orchestra leaders of the day.  These include starting on top left:  Ralph Kirbery, Tempo King, Wayne King, Hal Kemp, Guy Lombardo, Little Jack Little, Eddie Lane.  2nd row:  Clyde Lucas, Ted Lewis, Ann Leaf, Vincent Lopez, Abe Lyman, Jimmie Lunceford, Arthur Lang.  3rd row:  Terri La Franconi, Barry McKinley, Johnny Messner, Freddy Martin, Russ Morgan, Jean Meakin, Rose Marie.  4th row:  Edward Matthews, Waldo Mayo, Ozzie Nelson, Will Osborne, George Olsen, Louis Panico, Carl Ravell.  5th row:  Freddie Rich, Sammy Robbins, Dave Rubinoff, Dick Stabile, Jerry Sears, Ted Straeter, Shirley Lloyd.  6th row:  Joe Sanders, Lee Sullivan, Bert Shefter, Frances Saunders, Anthony Trini, Maxine Tappan, Rudy Vallee.  7th row:  Peter Van Steeden, Paul Whiteman, Chick Webb, Ted Weems, Anson Weeks, Fats Waller, Joan Whitney.', date: 'n.d.', tags: 'Musicians; Sheet Music; Sanders, Joe', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/CoonSanders&CISOPTR=270&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/CoonSanders&CISOPTR=270', width: '750', height: '1071', address: '', latitude: '', longitude: '', angle: '', location_id: '7658', active: 'false', created_at: '2016-09-24 18:12:18 UTC', updated_at: '2016-10-24 00:25:11 UTC', )
