    Photo.find(12114).update!(id: '12114', name: 'Louise Wittig Betz and Family', description: 'Exterior view, family portrait of Mrs. Carl (Louise) Betz and children.  Ages at time of the picture, late spring 1899:  Mrs. Carl Betz, 33; Annette, 12; Alma, 10; Martha, 8; Carl Egmont, 6; Carl William, 2;, Louise Julia, about 6 months (she was born after her father\'s death).  Back of photo reads:  "This picture was taken by a street photographer who happened to come along just as the family was leaving the house.  This was about a year after the death of Carl Betz.  The Betz home is to the left. (430 Bellefontaine Avenue, Kansas City, Mo.)  Only the porch railing can be seen".', date: '1899', tags: 'Betz Family; Betz, Louise W.; Betz, Annette; Betz, Alma', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Family&CISOPTR=5&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Family&CISOPTR=5', width: '750', height: '956', address: '', latitude: '', longitude: '', angle: '', location_id: '10170', active: 'false', created_at: '2016-09-24 23:26:43 UTC', updated_at: '2016-10-24 00:35:45 UTC', )
