    Photo.find(13527).update!(id: '13527', name: 'Dalton Defenders', description: 'Postcard with title Dalton Defenders and contains pen sketches of C.T. Connelly, L.M. Baldwin, Geo. B. Cubine and Chas. Brown.  Pub. by Gough Photo Services, Tulsa, Oklahoma.  Inscription on back reads:  The four who died on the side of the law in the Dalton Raid were just average Coffeyville citizens.  Brown and Cubine were shoemakers.  Baldwin, youngest of the group at 23, was a clerk in a dry goods store.  Connelly carried the title of \'marshal\' but was actually a school teacher.  It is to their memory that the Dalton Defenders Museum in Coffeyville, Kansas, was dedicated on the 62nd anniversary of the Raid, Oct. 5, 1954.', date: 'n.d.', tags: 'Dalton Gang; Coffeyville, Kansas', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=240&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=240', width: '750', height: '1146', address: '', latitude: '', longitude: '', angle: '', location_id: '8248', active: 'false', created_at: '2016-09-25 07:38:44 UTC', updated_at: '2016-10-24 00:48:43 UTC', )
