    Photo.find(16429).update!(id: '16429', name: 'Kansas City Livestock Exchange Building', description: 'Full frontal and side view of the building located just west of State Line at 16th Street. "It was 105 by 127 feet, three stories high, of brick with stone trim and cost $35,000. Construction began May 1, 1876 and the work was completed in late November of that year" ("75 Years of Kansas City Livestock Market History," p. 6, [MVSC Q 338.17 K16S].', date: '1880', tags: 'Historic buildings;; Livestock Exchange Building;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=3146&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=3146', width: '750', height: '615', address: '', latitude: '', longitude: '', angle: '', location_id: '14155', active: 'false', created_at: '2016-09-25 18:45:47 UTC', updated_at: '2016-10-24 01:10:50 UTC', )
    Photo.find(16432).update!(id: '16432', name: 'Kansas City Livestock Exchange Building', description: 'Full frontal and side view of building at 1601 Genessee, looking southwest. Livestock pens and chutes to the north and west of the building. Streetcar passing in front. "Construction began in 1909 and the building was finished in 1911--a nine story, brick faced structure of reinforced concrete, fronting 250 feet on Genessee street at 16th, with three wings extending 126 feet to the west. It was the largest livestock exchange building in the world and one of the largest office structures in Kansas at that time" ("75 Years of Kansas City Livestock Market History," p. 12, [MVSC Q 338.17 K16S].', date: 'circa 1930s', tags: 'Historic buildings;; Livestock Exchange Building;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=3149&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=3149', width: '750', height: '615', address: '', latitude: '', longitude: '', angle: '', location_id: '13008', active: 'false', created_at: '2016-09-25 18:46:11 UTC', updated_at: '2016-10-24 01:10:51 UTC', )
