    Photo.find(18646).update!(id: '18646', name: 'Trinity Lutheran Hospital', description: 'Full frontal and side view, looking southeast; located on southeast corner of 30th and Wyandotte. Trinity Lutheran was formerly known as the Swedish Hospital that began in 1906. When it outgrew its facility at 1334 E. 8th Street, it purchased this building, known as the Penn Valley Hospital. The Swedish Hospital changed its name to Trinity Lutheran in 1921. In 2001 the hospital merged with the Baptist Medical Center, forming a new entity called Baptist-Lutheran Medical Center, and vacating the building at 30th and Wyandotte.', date: '1950', tags: 'Hospitals;; Penn Valley Hospital; Swedish Hospital; Trinity Lutheran Hospital;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=5367&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=5367', width: '750', height: '615', address: '', latitude: '', longitude: '', angle: '', location_id: '11871', active: 'false', created_at: '2016-09-25 23:36:25 UTC', updated_at: '2016-10-24 01:28:33 UTC', )
