    Photo.find(21082).update!(id: '21082', name: 'Proposed Viaduct over Mill Creek', description: '"Proposed viaduct to carry street cars over Mill Creek Parkway at 43rd Street." Consulting engineers were Harrington, Howard, Ash. Drawing has been superimposed on photo. Mill Creek Parkway was later renamed J. C. Nichols Parkway. Handwritten note on the back identifies this as a bridge at Broadway and 43rd. Broadway is north of 43rd and south of 43rd it becomes J. C. Nichols Parkway.', date: '1926', tags: 'Bridges; Drawings;; 43rd Street; Broadway Boulevard; Mill Creek Parkway;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7816&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7816', width: '750', height: '481', address: '', latitude: '', longitude: '', angle: '', location_id: '9801', active: 'false', created_at: '2016-09-26 04:54:30 UTC', updated_at: '2016-10-24 01:48:34 UTC', )
    Photo.find(21083).update!(id: '21083', name: 'Corps of Discovery Sculpture', description: 'The bronze statue entitled "Corps of Discovery" is located in Case Park at 8th and Jefferson streets in Kansas City, Missouri. Sculpted by Eugene Daub, the Lewis and Clark statue, commemorating the Lewis and Clark expedition, is 18 feet tall and 21 feet wide. The five figures are Lewis, Clark, Sacagawea, York, and Seaman, Lewis\' dog. It was dedicated April 20, 2000. A replica of the sculpture can be seen in the Missouri Valley Room of the Kansas City Public Library.', date: '2003', tags: 'Sculpture; Monuments;; Lewis and Clark Point; Lewis and Clark Expedition; Lewis, Meriwether; Clark, William; Statues; Daub, Eugene; Sacagawea; York; Case Park; Corps of Discovery Sculpture;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7817&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7817', width: '750', height: '1133', address: '', latitude: '', longitude: '', angle: '', location_id: '13733', active: 'false', created_at: '2016-09-26 04:54:38 UTC', updated_at: '2016-10-24 01:48:38 UTC', )
