    Photo.find(21150).update!(id: '21150', name: 'Garment District Museum', description: 'Exterior view which features a group of unidentified women, part of the "Women in Purple" club  who attended the dedication of the Garment District Museum and sewing needle sculpture.  Event took place on October 4, 2002, in the historic Garment District located in the Broadway, 6th to 11th Streets area.  Other attendees can be seen behind the women.  Event took place at 8th and Banks.', date: '2002-10-04', tags: 'Dedications; Galleries & museums; Clothing industry; Women;; Museums; Garment District; Garment (Wholesale) Historic District;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7886&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7886', width: '750', height: '519', address: '', latitude: '', longitude: '', angle: '', location_id: '13324', active: 'false', created_at: '2016-09-26 05:03:19 UTC', updated_at: '2016-10-24 01:49:31 UTC', )
    Photo.find(21153).update!(id: '21153', name: 'Garment District Sculpture', description: 'Side view of the Garment District sculpture which consists of a metal sewing needle and a four hole red button at the base.  Photograph was taken during the dedication of the sculpture and the Garment District Museum, located in Kansas City\'s historic Garment District at 8th and Bank Streets near Broadway.  No identification for the group of people included in the scene.  Dedication took place on October 4, 2002.', date: '2002-10-04', tags: 'Sculpture; Dedications; Clothing industry;; Garment District; Garment (Wholesale) Historic District;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7889&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7889', width: '750', height: '1142', address: '', latitude: '', longitude: '', angle: '', location_id: '13763', active: 'false', created_at: '2016-09-26 05:03:42 UTC', updated_at: '2016-10-24 01:49:34 UTC', )
    Photo.find(21157).update!(id: '21157', name: 'Ilus W. Davis Park', description: 'View looking toward the south, taken from the steps of the Whittakker United States Courthouse on 9th Street.  View includes Ilus W. Davis Park construction work.  Also gives a full view of City Hall and a portion of the Richard Bolling Federal Building on the left and the Kansas City Public Library on the right.  Street barriers placed in front of the courthouse are also visible.', date: '2001-06-30', tags: 'Parks; City & town halls;; Ilus W. Davis Park; City Hall (12th Street);', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7893&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7893', width: '750', height: '1136', address: '', latitude: '', longitude: '', angle: '', location_id: '13887', active: 'false', created_at: '2016-09-26 05:04:14 UTC', updated_at: '2016-10-24 01:49:38 UTC', )
    Photo.find(21158).update!(id: '21158', name: 'Ilus W. Davis Park', description: 'View taken from 11th Street in front of City Hall looking toward the north.  Construction work for the Ilus W. Davis Park, located between Oak, Locust, 11th and 9th Streets, is in view. The Charles Evan Whittaker United States Courthouse is in view at the north end of the park.', date: '2001-06-30', tags: 'Parks; Courthouses; Administrative agencies;; Ilus W. Davis Park; U. S. Federal Court, Western District of Missouri; Federal Buildings; Charles Evans Whittaker United States Courthouse; Davis, Ilus W.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7894&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7894', width: '750', height: '517', address: '', latitude: '', longitude: '', angle: '', location_id: '13368', active: 'false', created_at: '2016-09-26 05:04:22 UTC', updated_at: '2016-10-24 01:49:40 UTC', )
    Photo.find(21159).update!(id: '21159', name: 'Ilus W. Davis Park', description: 'Roof-top view of Ilus W. Davis Park, looking toward the north.  Photograph was taken from the top level of the City Hall building.  The Charles Evans Whittaker United States Courthouse is in view at the north end of the park.  Streets in view going north and south include Oak Street on the right and Locust Street on the left.  Intersecting streets include 10th Street which cuts through the park and 9th Street at the north end of the park. The U.S. Department of Transportation Regional Headquarters building that houses the Federal Aviation Administration is located on the southeast corner of 9th and Locust (901 Locust St.).  A portion of the old Kansas City Public Library building is visible on the northeast corner of the same intersection.  A large round reflecting pool is visible in the lower center of the picture.', date: '2002-05-30', tags: 'Parks; Courthouses; Administrative agencies; Reflecting pools;; Federal Buildings; Charles Evans Whittaker United States Courthouse; U. S. Federal Court, Western District of Missouri; Davis, Ilus W.; Whittaker, Charles E.; Ilus W. Davis Park;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7895&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7895', width: '750', height: '1137', address: '', latitude: '', longitude: '', angle: '', location_id: '13792', active: 'false', created_at: '2016-09-26 05:04:30 UTC', updated_at: '2016-10-24 01:49:42 UTC', )
