    Photo.find(21200).update!(id: '21200', name: 'U.S. Constitution Commerative Plaque', description: 'View of the trunk of oak tree and plaque located near the entrance to Swope Park.  This tree had a plaque placed by it in 1937 by the local chapter of the Colonial Dames of America.  The plaque commerated the 150th anniversary of the adoption of the U.S. Constitution.  The plaque was stolen, later found and restored, and rededicated on September 17, 1987 by the same Colonial Dames of America chapter.  Two page explanation of the history of the plaque is included in the folder with the photographs.', date: 'circa 1987', tags: 'Plaques; Trees; Patriotic societies; Constitutions;; Swope Park;Colonial Dames of America;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7936&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7936', width: '750', height: '1164', address: '', latitude: '', longitude: '', angle: '', location_id: '9356', active: 'false', created_at: '2016-09-26 05:09:58 UTC', updated_at: '2016-10-24 01:50:17 UTC', )
