    Photo.find(21206).update!(id: '21206', name: 'Union Station and Downtown Kansas City Skyline', description: 'View looking toward the northeast taken from Liberty Memorial.  Gives a full view of the Union Station building and some railroad tracks as well as the skyline of downtown Kansas City, Missouri.  The Coca-Cola (Western Auto) building is in view on the right and an electric tolley car can be seen traveling on Main Street which runs along the east side of Union Station.', date: 'circa 1940s', tags: 'Railroad stations; Cityscapes; Street railroads;; Union Station; Coca-Cola Building; Main Street; Skylines;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7942&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7942', width: '750', height: '450', address: '', latitude: '', longitude: '', angle: '', location_id: '12204', active: 'false', created_at: '2016-09-26 05:10:47 UTC', updated_at: '2016-10-24 01:50:21 UTC', )
    Photo.find(21208).update!(id: '21208', name: 'Cabin near Rice-Tremonti Home', description: 'Full view of a log cabin identified on the back of the photograph as "Rice Cabin" or known as Aunt Sophie\'s cabin or kitchen located on the Archibald Rice, later Dr. Louis Tremonti, homesite.  Notation on back indicates that this cabin, first built in 1821, is the oldest house in Jackson County.  It is located at 66th and Blue Ridge Boulevard near the Rice-Tremonti house.  The cabin has been restored several times over the years.', date: '', tags: 'Log cabins; Slave quarters;; Rice-Tremonti Home;Aunt Sophie\'s Cabin; African Americans;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7944&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7944', width: '750', height: '821', address: '', latitude: '', longitude: '', angle: '', location_id: '8047', active: 'false', created_at: '2016-09-26 05:11:02 UTC', updated_at: '2016-10-24 01:50:22 UTC', )
    Photo.find(21215).update!(id: '21215', name: 'Construction Work at 6th and Broadway', description: 'View of unidentified construction workers and activity taking place at the northwest corner of 6th and Broadway in Kansas City, Missouri.  Two businesses located in the center of the view include Frank Cain and Co. at 604 Broadway and KC Cap Co. at 606 Broadway.  Also visible on 6th Street:  a Coca-Cola Bottling sign, Muehlebach\'s Pilsener Beer sign, and American & Green Candy Kitchen.  Date is penciled in on top of photograph.', date: '1911-06-10', tags: 'Construction workers; Construction equipment; Building materials; Streets;; Broadway Boulevard; 6th Street;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7951&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7951', width: '750', height: '611', address: '', latitude: '', longitude: '', angle: '', location_id: '14134', active: 'false', created_at: '2016-09-26 05:11:58 UTC', updated_at: '2016-10-24 01:50:27 UTC', )
