    Photo.find(21217).update!(id: '21217', name: 'Construction Work at 6th and Broadway', description: 'A view of unidentified building construction activity taking place at the northwest corner of 6th and Broadway in Kansas City, Missouri.  Building signs visible in the view include:  Coca-Cola , Columbia Shade Cloth, American Casket Co., and Rothernberg cigars.  Date is penciled in on top of photograph.', date: '1911-06-10', tags: 'Construction workers; Building materials; Buildings;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7953&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7953', width: '750', height: '597', address: '', latitude: '', longitude: '', angle: '', location_id: '14134', active: 'false', created_at: '2016-09-26 05:12:14 UTC', updated_at: '2016-10-24 01:50:28 UTC', )
    Photo.find(21222).update!(id: '21222', name: 'Hey-Hay Club', description: 'Street level view of local speakeasy/nightclub Hey-Hay Club located at 4th and Cherry. Photograph was made from image as published in the "Future" newsweekly, Vol. 1, No. 12, March 29, 1935, p. 1, MVSC F051 F996.  As stated in this publication concerning this club, "our 10-cent beer was served in 26-ounce schooners and tasted of soap, ether, sour mash and, oddly enough, onions."', date: '1935', tags: 'Nightclubs; Speakeasies;; Hey-Hay Club; Taverns;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7958&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7958', width: '750', height: '432', address: '', latitude: '', longitude: '', angle: '', location_id: '14205', active: 'false', created_at: '2016-09-26 05:12:53 UTC', updated_at: '2016-10-24 01:50:31 UTC', )
    Photo.find(21227).update!(id: '21227', name: 'Local Nightclubs', description: 'Composite photograph which features eight different nightclubs/speakeasies located in Kansas City during the 1930s.  Photograph was made from image as published in the "Future" newsweekly, Vol. 1, No. 12, March 29, 1935, p. 1, MVSC F051 F996.  Includes:  Dante\' Inferno, Red & Dutch at 924-28 W. 8th, Hey-Hay Club at 4th and Cherry, DeLuxe Night Club, Harlem Nite Cub, Wiggle Inn, Derby Tavern, and King Kong on 12th Street.', date: '1935', tags: 'Nightclubs; Speakeasies; Composite photographs;; Taverns;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7963&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7963', width: '750', height: '927', address: '', latitude: '', longitude: '', angle: '', location_id: '13386', active: 'false', created_at: '2016-09-26 05:13:32 UTC', updated_at: '2016-10-24 01:50:35 UTC', )
    Photo.find(21230).update!(id: '21230', name: 'Dr. S. S. Todd', description: 'Portrait identified on the back as:  "Dr. S. S. Todd, one of the early physicians of K.C. Practiced here in the 70\'s and later."  Dr. Todd is first listed in the 1867-68 Kansas City Directory.  In the 1880 directory his practice is listed at the sw corner of 8th and Main and his residence at 1115 Walnut.', date: '', tags: 'Physicians; Portrait photographs;; Todd, Simeon S., Dr.', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7966&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7966', width: '750', height: '1306', address: '', latitude: '', longitude: '', angle: '', location_id: '13773', active: 'false', created_at: '2016-09-26 05:13:55 UTC', updated_at: '2016-10-24 01:50:37 UTC', )
    Photo.find(21232).update!(id: '21232', name: 'U.S. Engineering Co.', description: 'Exterior, street level view of a group of unidentified men both standing and seated in two rows, presumably employees of the U.S. Engineering Co., Nottberg Bros.  Included in the view are pieces of company equipment.  U.S. Engineering Co. is listed in the 1910 Kansas City directory at 107 W. 13th Street (John and Henry Nottberg).  They are listed in the 1919 Kansas City directory at 914 Campbell, owned by Nottberg Bros.', date: 'circa 1915-20', tags: 'Group portraits;; U.S. Engineering Company;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7968&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7968', width: '750', height: '626', address: '', latitude: '', longitude: '', angle: '', location_id: '', active: 'false', created_at: '2016-09-26 05:14:10 UTC', updated_at: '2016-10-23 23:14:15 UTC', )
    Photo.find(21237).update!(id: '21237', name: 'H. Roe Bartle at First Kansas City A\'s Game', description: 'Kansas City mayor H. Roe Bartle is seated at the first Kansas City A\'s game held at Municipal Stadium. Missouri Governor James T. Blair is seated two rows behind Bartle next to the right of the patrolmen. Former Kansas City mayor William Kemp is  third from Bartle\'s right.', date: 'April 12, 1955', tags: 'Mayors; Baseball; Stadiums;; Bartle, H. Roe; Kemp, William E.; Blair, James T., Jr.; Municipal Stadium; Kansas City Athletics;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7973&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7973', width: '750', height: '616', address: '', latitude: '', longitude: '', angle: '', location_id: '11129', active: 'false', created_at: '2016-09-26 05:14:49 UTC', updated_at: '2016-10-24 01:50:41 UTC', )
    Photo.find(21262).update!(id: '21262', name: 'Kansas City Public Libary Event', description: 'Interior view, library location at 9th and Locust, with three men and a woman in view.  Event is not identified, perhaps 75th anniversary of the library?  Only identification, 2nd from left - Roy Joslin, Kansas City Board of Education member and 2nd from the right - Harry Brinton, library director, 1947-1949.', date: 'circa 1945-50', tags: 'Libraries;; Kansas City Public Library;Brinton, Harry; Joslin, Roy;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=7999&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=7999', width: '750', height: '974', address: '', latitude: '', longitude: '', angle: '', location_id: '7410', active: 'false', created_at: '2016-09-26 05:18:04 UTC', updated_at: '2016-10-24 01:50:55 UTC', )
