    Photo.find(21371).update!(id: '21371', name: 'Highland Cemetery', description: 'View of grave marker in Highland Cemetery for Dr. Thomas Unthank (1866-1932).  Cemetery is located on the west side of Blue Ridge between 19th to 21st Street in Independence, Missouri, just east of Kansas City, Missouri.  Several noted African Americans are buried here.  Dr. Unthank opened Lange Hospital in Kansas City, Missouri, and co-founded, with Dr. S. H. Thompson, Douglass Hospital in Kansas City, Kansas, all African American hospitals.', date: '2007-04-04', tags: 'Cemeteries; Graves; Tombs & sepulchral monuments; Physicians;; Highland Cemetery; African Americans;Unthank, Thomas C.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8108&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8108', width: '750', height: '506', address: '', latitude: '', longitude: '', angle: '', location_id: '12737', active: 'false', created_at: '2016-09-26 05:32:23 UTC', updated_at: '2016-10-24 01:52:12 UTC', )
