    Photo.find(21373).update!(id: '21373', name: 'Highland Cemetery, Gravestone for Lafayette A. Tillman', description: 'View of grave marker for Lafayette A. Tillman in Highland Cemetery which is located on the west side of Blue Ridge between 19th to 21st Street in Independence, Missouri, just east of Kansas City, Missouri. Several noted African Americans are buried here. Lafayette Tillman was a soldier, a scholar, and one of the Kansas Citys first African American citizens to be appointed to the police force.', date: '2007-04-04', tags: 'Cemeteries; Graves; Police; Tombs & sepulchral monuments;; African Americans; Highland Cemetery; Tillman, Lafayette A.;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8110&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8110', width: '750', height: '1126', address: '', latitude: '', longitude: '', angle: '', location_id: '12737', active: 'false', created_at: '2016-09-26 05:32:39 UTC', updated_at: '2016-10-24 01:52:14 UTC', )
