    Photo.find(21397).update!(id: '21397', name: 'Scarritt School', description: 'Exterior, full street level view of the Scarritt Elementary School located at Lexington and Askew Avenues in Kansas City, Missouri.  Photograph was taken from the Twenty-eighth Annual Report of the Board of Education of the Kansas City Public Schools, for the year ending June 30, 1899, p. 140 (MVSC 093 K16 1899).', date: 'circa 1899', tags: 'Schools;; Scarritt School; Elementary Schools; Kansas City School District;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8134&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8134', width: '750', height: '486', address: '', latitude: '', longitude: '', angle: '', location_id: '14363', active: 'false', created_at: '2016-09-26 05:35:46 UTC', updated_at: '2016-10-24 01:52:29 UTC', )
    Photo.find(21403).update!(id: '21403', name: 'Ben Jaudon and Cornerstone', description: 'Exterior view of Ben Jaudon, Director of Finance for Kansas City, Missouri, standing by a cornerstone among rubble from the demolishment of the Little Sisters of the Poor, Home for the Aged.  The cornerstone was laid when the building was built and first used as an orphan and widows home for Confederate veterans of the Civil War.  Engraved on the cornerstone can be seen the names of the officers of the widows and orphans home:  W. R. Bernard, president; S. P. Twiss, vice president; Theodore S. Case, secretary; J. J. Martin, treasurer; and Mrs. M. A. Lykins, superintendent.  The back side contained the names:  A. J. Kelly, architect; and J. M. Jackson, contractor.  The cornerstone is dated June 24, 1874.  Mr. Jaudon\'s hand is resting on the copper box which was found empty.  The location is south of 31st Street and west of Gillham Road.', date: '1927-07', tags: 'Cornerstones; Demolition;; Little Sisters of the Poor;Home For the Aged;Confederate Widows and Orphans Home;Jauden, Ben;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8140&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8140', width: '750', height: '995', address: '', latitude: '', longitude: '', angle: '', location_id: '11541', active: 'false', created_at: '2016-09-26 05:36:32 UTC', updated_at: '2016-10-24 01:52:34 UTC', )
