    Photo.find(21415).update!(id: '21415', name: 'Aerial View of Downtown', description: 'Aerial view of downtown Kansas City, Missouri, looking southeast. The double-towered building at center is the Fidelity National Bank building at southeast corner of 9th and Walnut. 6th Street Trafficway is under construction. City Market is in the left foreground. The handwritten words "Present" and "Future" above arrows pointing to buildings may refer to the Kansas City Public Library.', date: 'circa 1957', tags: 'Aerial photographs; Buildings; Business districts;; 6th Street Trafficway; City Market; Riverfront Area;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8156&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8156', width: '750', height: '596', address: '', latitude: '', longitude: '', angle: '', location_id: '14185', active: 'false', created_at: '2016-09-26 05:38:11 UTC', updated_at: '2016-10-24 01:52:42 UTC', )
    Photo.find(21418).update!(id: '21418', name: 'Central Webster Club Group Portrait', description: 'Oval group portrait of the Central Webster Club, Central High School, Kansas City, Missouri. Paper note attached (not part of image) lists names of those pictured, with a small diagram for identification. Included in the photograph are Joseph E. Brown, Meade Woodson, Edmund Field, William McPherrin, Francis McCarty, Harry Ghormley, Harry Owen, John C. Musselman, Arvid Frank, Charles Wilhelm, Mr. C. H. Nowlin, Mr. E. E. Rush, Clarence Milton, Stanley Clausen, Lloyd Charlesworth, Russell Colton, Hale Cook, George E. Edwards, Clarence Mooney, Thodore Misselwitz, Henry R. O\'Brien, Frank Siegrist, Clarence Timanus, Roscoe Wallis, Horace Mitchell, Earl Moore. Also noted on the attached paper is that the photograph was a gift of Dr. Henry R. O\'Brien, Camp Hill, PA. Photo has been removed from original mount.', date: '1908', tags: 'Clubs; Group portraits; Students;; Central High School;', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/Montgomery&CISOPTR=8159&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/Montgomery&CISOPTR=8159', width: '750', height: '531', address: '', latitude: '', longitude: '', angle: '', location_id: '10550', active: 'false', created_at: '2016-09-26 05:38:34 UTC', updated_at: '2016-10-24 01:52:44 UTC', )
