    Photo.find(22064).update!(id: '22064', name: 'H. Roe Bartle, Les Milgram, and Others', description: 'South Central Business Association event to honor Milgram\'s on its 50th anniversary.  Left to right (standing): H. Roe Bartle, Charlotte Milgram Wien (daughter of Nat Milgram, Founder of Milgram Food Stores, and wife of Stuart L. Wien, Milgram executive), Nancy Milgram (daughter of Lester F. Milgram), Lester F. Milgram (son of Nat and Fannye Milgram and President of Milgram Food Stores at the time of this photo), Mildred R. Wien (wife of Julius Wien and mother of Stuart L. Wien), Julius Wien (husband of Mildred R. Wien and father of Stuart L. Wien), Stuart L. Wien (Milgram executive), Audree Milgram Klein (daughter of Nat Milgram and wife of William Klein, Milgram executive), and William Klein. Left to right (sitting): Ann Milgram (wife of Lester F. Milgram) and Fannye Milgram (wife of Nat Milgram, Founder of Milgram Food Stores). Nat Milgram, Founder of Milgram Food Stores, was born on March 16, 1893 and died on January 21, 1958. Lester Frederick Milgram was born on July 29, 1917 and died on June 19, 1976.', date: 'May 28, 1963', tags: 'Milgram, Les; Mayors; Bartle, H. Roe; South Central Business Association', image_url: 'http://www.kchistory.org/cgi-bin/getimage.exe?CISOROOT=/South&CISOPTR=3629&DMSCALE=100&DMWIDTH=0&DMHEIGHT=0&DMX=0&DMY=0&DMTEXT=&DMTHUMB=&DMROTATE=0', thumbnail_url: 'http://www.kchistory.org/cgi-bin/thumbnail.exe?CISOROOT=/South&CISOPTR=3629', width: '750', height: '603', address: '', latitude: '', longitude: '', angle: '', location_id: '9489', active: 'false', created_at: '2016-09-26 07:02:43 UTC', updated_at: '2016-10-24 01:59:18 UTC', )
